import React from 'react';
import { Typed } from 'react-typed';
import './About.css';
import profileImage from '../Uploads'; // Adjust the path as needed

const About = () => {
    return (
        <section id="about" className="about-section">
            <div className="about-content">
                <div className="about-image">
                    <img src={profileImage} alt="Profile" />
                </div>
                <div className="about-text">
                    <h2>
                        <Typed
                            strings={['Hello']}
                            typeSpeed={70}
                            showCursor={false}
                        />
                    </h2>
                    <h2>
                        <Typed
                            strings={['My Name is']}
                            startDelay={1000}
                            typeSpeed={70}
                            showCursor={false}
                        />
                    </h2>
                    <h2>
                        <Typed
                            strings={['Vijayalakshmi']}
                            startDelay={2000}
                            typeSpeed={70}
                            showCursor={false}
                        />
                    </h2>
                    <h2>
                        <Typed
                            strings={['Vardineedi']}
                            startDelay={3000}
                            typeSpeed={70}
                            showCursor={false}
                        />
                    </h2>
                </div>
            </div>
        </section>
    );
};

export default About;
